import React from "react";
import { Box, Text } from "@chakra-ui/react";
function Game3() {
  return (
    <div>
      <Box
        display="flex"
        flexDirection="column"
        alignItems="center"
        mt={1}
        width="250px"
        height="250px"
      >
        <Text>Game3</Text>
      </Box>
    </div>
  );
}

export default Game3;
